
DROP COORDINATOR TABLES IF EXIST;
CREATE COORDINATOR TABLES;

DROP NAMESPACE IF EXISTS dynamons CASCADE;
DROP NAMESPACE IF EXISTS postgresns CASCADE;
DROP NAMESPACE IF EXISTS cassandrans CASCADE;

CREATE NAMESPACE dynamons;
CREATE NAMESPACE postgresns;
CREATE NAMESPACE cassandrans;

CREATE TABLE dynamons.customer (
    c_custkey int,
    c_name text,
    c_address text,
    c_nationkey int,
    c_phone text,
    c_acctbal double,
    c_mktsegment text,
    c_comment text,
    PRIMARY KEY (c_custkey)
) WITH 'no-scaling' = 'true' AND 'no-backup' = 'true';

CREATE TABLE postgresns.orders (
    o_orderkey int,
    o_custkey int,
    o_orderstatus text,
    o_totalprice double,
    o_orderdate text,
    o_orderpriority text,
    o_clerk text,
    o_shippriority int,
    o_comment text,
    PRIMARY KEY (o_orderkey)
);

CREATE TABLE cassandrans.lineitem (
    l_orderkey int,
    l_partkey int,
    l_suppkey int,
    l_linenumber int,
    l_quantity int,
    l_extendedprice double,
    l_discount double,
    l_tax double,
    l_returnflag text,
    l_linestatus text,
    l_shipdate text,
    l_commitdate text,
    l_receiptdate text,
    l_shipinstruct text,
    l_shipmode text,
    l_comment text,
    PRIMARY KEY (l_orderkey, l_linenumber)
);
